Valkyries are virgin warriors of the Norse god, Odin, and they protect the humans from demons of the outskirts. Yet the demons have found the Valkyries' weakness after the betrayal of the goddess, Freya, to become a sex slave. Thus one Valkyrie was made a sex slave after being threatened that her kinsmen will share the same fate if she did not submit. With the castle taken over, the demons challenged all of the men to impregnate her, if they wish to live...

